import * as React from "react";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Box from "@mui/material/Box";
import Icon from "@mui/material/Icon";

const Sidebar = () => {
    const [value, setValue] = React.useState("one");

    const handleChange = (event: React.SyntheticEvent, newValue: string) => {
        setValue(newValue);
    };

    return (
        <Box sx={{ display: "flex" }}>
            <Box sx={{ width: "200px" }}>
                <Tabs
                    orientation="vertical"
                    variant="scrollable"
                    value={value}
                    onChange={handleChange}
                    aria-label="sidebar tabs"
                >
                    <Tab value="one" icon={<Icon>add_circle</Icon>} label="Tab 1" />
                    <Tab value="two" icon={<Icon>shopping_cart</Icon>} label="Tab 2" />
                    <Tab value="three" icon={<Icon>star</Icon>} label="Tab 3" />
                </Tabs>
            </Box>
            <Box sx={{ flex: 1, padding: "16px" }}>
                {value === "one" && <div>Tab 1 Content</div>}
                {value === "two" && <div>Tab 2 Content</div>}
                {value === "three" && <div>Tab 3 Content</div>}
            </Box>
        </Box>
    );
};

export default Sidebar;
